import React from 'react';

function HomePage() {
  return (
    <div className="flex flex-col items-center justify-center p-6">
      <h2 className="text-4xl font-bold mb-6 text-blue-600">Welcome to Resume Editor</h2>
      <img
        src="https://images.unsplash.com/photo-1504384308090-c894fdcc538d?auto=format&fit=crop&w=800&q=80"
        alt="Resume Illustration"
        className="rounded shadow-lg max-w-full h-auto"
      />
      <p className="mt-4 text-lg text-gray-700 max-w-xl text-center">
        Click on any section in the navigation bar to edit your resume in a more attractive and effective manner.
      </p>
    </div>
  );
}

export default HomePage;
